import React from 'react';
import {PropertyDescripcitionWrapper} from "./styled";



export const PropertyDescription = () => {
    return (
        <PropertyDescripcitionWrapper>
            <h4>descripcion</h4>
            <p>Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem
                Ipsum ha sido el texto de relleno estándar de las industrias dun libro de textos especimen.
                No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos
                electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la
                creación de las hojas "Letraset".</p>
        </PropertyDescripcitionWrapper>
    );
};
